INSERT INTO `cells` VALUES (0,'<h3>Старт</h3>\n<p>Эта клетка — начало вашего революционного пути. Каждый раз проходя через неё вы получаете двойное пополнение армии.</p>',NULL,NULL,NULL,'mono-cell start',NULL,NULL,NULL,'',0,0,1,0,0,0,0,0,NULL),(1,'<h3>Телефон, Гомель</h3>\n<p>Гомельская телефонная станция неплохо охраняется, однако для установления власти в этом городе её придется захватить.</p>','<h3>Телефон, Гомель</h3>\n<p>Сейчас идет сражение за станцию телефонной связи в Гомеле. Принять непосредственное участие в сражении можно на <a class=\"level-link\" level-number=\"10\" level-key=\"meat4\">&nbsp;</a>.</p>','<h3>Телефон, Гомель</h3>\n<p>Вы захватили станцию телефонной связи, став еще на шаг ближе к мировому господству пролетариата. Теперь станция обеспечивает связь подразделений вашей армии, а благодаря работе агитаторов, посетители станции чаще записываются в добровольцы.</p>','<h3>Телефон, Гомель</h3>\n<p>Убегая с поля боя, вы разрушили станцию связи. Захватывать тут больше нечего, да и Советскую власть в этом городе уже не установить.</p>','mono-cell phone gomel','mono-cell phone gomel flame','mono-cell phone gomel soviet','mono-cell phone gomel ruined','',3,1,1,1000,50,0,0,0,'7d6988b9049359eaac01ac374beec86f'),(2,'<h3>Телеграф, Могилев</h3>\n<p>Телеграф для дела революции настолько же важен, как и другие комуникации. Для установления власти совета народных депутатов в Могилеве придется захватить и его.</p>','<h3>Телеграф, Могилев</h3><p>Вы напали на охрану телеграфа. Подробнее об этом в <a class=\"level-link\" level-number=\"17\" level-key=\"caterpillar\">&nbsp;</a>.</p>','<h3>Телеграф, Могилев</h3><p>Могилевский телеграф взят. Можете прямо сейчас телеграфировать об этом своему руководству.</p>','<h3>Телеграф, Могилев</h3>\n<p>Спасаясь от превосходящих сил соперника, вы приняли решение взорвать телеграф. Теперь он не достанется никому.</p>','mono-cell telegraph mogilev','mono-cell telegraph mogilev flame','mono-cell telegraph mogilev soviet','mono-cell telegraph mogilev ruined','',6,1,1,2000,100,0,0,0,'ac9021f07a14061d1342422e5335fd1e'),(3,'<h3>Ж/Д станция, Витебск</h3><p>Железнодорожная станция. Нагромождение рельс, перронов и залов ожидания. Довольно немаленький вокзал хорошо охраняется, поэтому для захвата станции придется попотеть. Но ведь это ради революции...</p>','<h3>Ж/Д станция, Витебск</h3><p>Солдаты, вооруженные разномастными винтовками и крестьяне, вооруженные тем, что было у них на подворьях, с переменным успехом штурмуют хорошо организованную оборону железнодорожной станции г. Витебска. Подробнее проследить за боем можно в <a class=\"level-link\" level-number=\"9\" level-key=\"779x\">&nbsp;</a>.</p>','<h3>Ж/Д станция, Витебск</h3><p>Не зря проливалась кровь революционеров - железнодорожная станция захвачена. Теперь можно организовывать поставки оружия и продовольствия в город, что безусловно будет способствовать становлению советской власти. Да и прибывающие на станцию пассажиры нет-нет да и присоединяются к нашим отрядам.</p>\n','<h3>Ж/Д станция, Витебск</h3><p>Железнодорожная станция разрушена, перроны взорваны, разорванные рельсы торчат в разные стороны. Обе стороны, еще недавно так страстно желавшие захватить станцию, уходят с позиций. В таком виде станция не представляет стратегического интереса.</p>','mono-cell railway vitebsk','mono-cell railway vitebsk flame','mono-cell railway vitebsk soviet','mono-cell railway vitebsk ruined','',2,1,1,3000,150,0,0,0,'cc45f38bfc785ec48b74a15ee528c0ea'),(4,'<h3>Телефон, Брест</h3><p>Из недр телефонной станции слышны щелчки реле и легкий запах подгорающих контактов. Простому рабочему не понять, почему это здание необходимо захватить, однако руководители обеих сторон знают ответ на этот вопрос — здание охраняется, а перед нами стоит задача его взять, если мы хотим установить в городе свою, советскую, власть.</p>','<h3>Телефон, Брест</h3><p>Самое главное при захвате телефонной станции — не застрелить телефонистку. Больше подробностей можно узнать в <a class=\"level-link\" level-number=\"4\" level-key=\"7opktt42\">&nbsp;</a>.</p>','<h3>Телефон, Брест</h3><p>Выставляйте караул, оперативно записывайте мужскую часть коллектива в красноармейцы и докладывайте о выполнении поставленной задачи.</p>','<h3>Телефон, Брест</h3><p>Телефонистку убили, провода тлеют в коробах, а коммутационные шкафы вряд ли можно узнать в этой куче металла. «Так не доставайся же ты никому!» - Думали вы, отдавая приказ уничтожить станцию.</p>','mono-cell phone brest','mono-cell phone brest flame','mono-cell phone brest soviet','mono-cell phone brest ruined','',1,1,1,1000,50,0,0,0,'e77ed6f1aca3cac064ca0a43f97b38e0'),(5,'<h3>Телеграф, Гродно</h3><p>Из помещений телеграфа раздаются мерные напевы знакомой отдельным бойцам азбуки морзе. Но чтобы услышать их, надо попасть внутрь, минуя охрану.</p>','<h3>Телеграф, Гродно</h3><p>Снять часовых без шума не удалось и завязался бой. Подробнее узнать о нем можно в <a class=\"level-link\" level-number=\"14\" level-key=\"networkd13\">&nbsp;</a>.</p>','<h3>Телеграф, Гродно</h3><p>Пара специально обученных бойцов передают сообщения в другие города, узнают обстановку по стране. Менее квалифицированные бойцы охраняют здание, а те, кто совсем ничего не умеет, агитируют прохожих вступить в рабоче-крестьянскую красную армию.</p>','<h3>Телеграф, Гродно</h3><p>Сейчас уже никто не сказал бы, что эта куча кирпичей была когда-то оживленным строением телеграфа.</p>','mono-cell telegraph grodno','mono-cell telegraph grodno flame','mono-cell telegraph grodno soviet','mono-cell telegraph grodno ruined','',4,1,1,2000,100,0,0,0,'1ccbef799abd332fa0f112adc28100be'),(6,NULL,NULL,NULL,'<h3>Удача!</h3><p>Наши идейные товарищи с кожевенной мануфактуры сами нашли вас и захотели вступить в ваш отряд, чтобы бороться с мировым капиталом и установить диктатуру пролетариата. К вашей армии примкнуло 200 человек.</p>','mono-cell bonus',NULL,NULL,'mono-cell bonus ruined','',0,0,1,0,0,200,0,1,NULL),(7,NULL,NULL,NULL,'<h3>Неудача...</h3><p>Царские солдаты неплохо обучены, в отличие от простых рабочих, сражающихся на вашей стороне. Попав в окружение, вы потеряли 150 бойцов.</p>','mono-cell penalty',NULL,NULL,'mono-cell penalty ruined','',0,0,1,0,0,0,150,1,NULL),(8,'<h3>Ж/Д станция, Гомель</h3><p>Гомель — довольно крупный железнодорожный узел, именно поэтому так важно захватить станцию.</p>','<h3>Ж/Д станция, Гомель</h3><p>Солдаты бегут по железнодорожному полотну, с разных сторон раздаются одиночные выстрелы. Не все понимают, что происходит. Подробнее о штурме можно узнать в <a class=\"level-link\" level-number=\"12\" level-key=\"seno1\">&nbsp;</a>.</p>','<h3>Ж/Д станция, Гомель</h3><p>По станции ходят красноармейцы и проводят инвентаризацию. Из проезжающих поездов удивленно смотрят интеллигентного вида господа, радостно смотрят рабочие. Некоторые из них готовы прервать свое путешествие чтобы примкнуть к вашему отряду.</p>','<h3>Ж/Д станция, Гомель</h3><p>Неудача. Неправильно спланированная атака на станцию нанесла урон не только по вашему самолюбию, но и по перспективам установления советской власти в городе, ведь станцию пришлось разрушить во время отступления.</p>','mono-cell railway gomel','mono-cell railway gomel flame','mono-cell railway gomel soviet','mono-cell railway gomel ruined','',3,1,1,3000,150,0,0,0,'86bfa914770825fe92bc8b0b276927c7'),(9,'<h3>Телефон, Могилев</h3><p>Узел телефонной связи неплохо было бы занять. Таковы указания вождя революции, Владимира Ильича, но на месте решать всё таки вам, можете ли вы себе позволить такие потери...</p>','<h3>Телефон, Могилев</h3><p>Вялый бой, редкие выстрелы с разных сторон, бойцы нехотя перемещаются с позиции на позицию. Подробности в <a class=\"level-link\" level-number=\"16\" level-key=\"tomcatcat\">&nbsp;</a>.</p>','<h3>Телефон, Могилев</h3><p>Телефонный узел связи г. Могилева теперь под управлением революционного движения в вашем лице. Ну что ж, пусть это будет еще один шаг к коммунизму.</p>','<h3>Телефон, Могилев</h3><p>Больше в Могилеве нет станции телефонной связи. Вы, обнаружив превосходящие силы противника, решили уничтожить её, пожертвовав станцией ради сохранения жизней своих солдат.</p>','mono-cell phone mogilev','mono-cell phone mogilev flame','mono-cell phone mogilev soviet','mono-cell phone mogilev ruined','',6,1,1,1000,50,0,0,0,'4245778452d69fcf9ec74a336e1b6f81'),(10,NULL,NULL,NULL,'<h3>Удача!</h3><p>Наша агитация в деревнях не проходит даром — 120 крестьян пополняют ваш отряд.</p>','mono-cell bonus',NULL,NULL,'mono-cell bonus ruined','',0,0,1,0,0,120,0,1,NULL),(11,'<h3>Военкомат</h3><p>Проходя мимо военкомата вы решили заглянуть в него и к вам присоединились 50 человек.</p>',NULL,NULL,NULL,'mono-cell rectal','mono-cell rectal flame','mono-cell rectal soviet',NULL,'',0,0,1,0,0,50,0,0,'b3e7ae222a85fac7f82750e0df9e0675'),(12,'<h3>Телеграф, Витебск</h3><p>Всё предельно просто — без возможности передавать точки и тире противник становится слабее. Было бы неплохо воспользоваться этим, а заодно и стать сильнее самим.</p>','<h3>Телеграф, Витебск</h3><p>Бой развязан, взять телеграф без выстрелов явно не получается. Что происходит видно в <a class=\"level-link\" level-number=\"8\" level-key=\"amn03\">&nbsp;</a>.</p>','<h3>Телеграф, Витебск</h3><p>Нелегкий был бой, но в итоге вы захватили телеграф. Это хорошо, теперь ваш агитационный пункт здесь приносит вам бойцов, не говоря уже про использование телеграфа по прямому назначению.</p>','<h3>Телеграф, Витебск</h3><p>Бой был тяжелый, ваш отряд нес постоянные потери, пришлось принимать непопулярное решение об отходе. Для того, чтобы немного подсластить пилюлю, вы разрушили телеграф.</p>','mono-cell telegraph vitebsk','mono-cell telegraph vitebsk flame','mono-cell telegraph vitebsk soviet','mono-cell telegraph vitebsk ruined','',2,1,1,2000,100,0,0,0,'6528e8396c06bec847ab4d37589d7cce'),(13,NULL,NULL,NULL,'<h3>Неудача...</h3><p>Ваш боец сортировал ящики с боеприпасами. Кто же знал, что он решит покурить в процессе. Вы потеряли 200 человек.</p>','mono-cell penalty',NULL,NULL,'mono-cell penalty ruined','',0,0,1,0,0,0,200,1,NULL),(14,'<h3>Телефон, Гродно</h3><p>Телефонная станция — одна из самых слабозащищенных стратегических точек Гродно. Можно захватить её, отделавшись малой кровью.</p>','<h3>Телефон, Гродно</h3><p>Сейчас идет бой за телефонную станцию. Трещат пулеметы, слышны одиночные беспорядочные выстрелы винтовок. Подробно следить за боем можно в <a class=\"level-link\" level-number=\"13\" level-key=\"8lima2\">&nbsp;</a>.</p>','<h3>Телефон, Гродно</h3><p>Телефонная станция под вашим контролем.</p>','<h3>Телефон, Гродно</h3><p>Взорвав телефонную станцию, вы на время отвлекли преследователей. Да, дела, а с виду казалось, что охраны на станции поменьше.</p>','mono-cell phone grodno','mono-cell phone grodno flame','mono-cell phone grodno soviet','mono-cell phone grodno ruined','',4,1,1,1000,50,0,0,0,'286fc7cfb4184a695b7f01962bf2b78f'),(15,'<h3>Ж/Д станция, Брест</h3><p>Контроль над железной дорогой является очень важной частью революционного плана товарища Ленина. Если вы в силах реализовать эту часть плана — дерзайте.</p>','<h3>Ж/Д станция, Брест</h3><p>Импровизированный бронепоезд революционеров въезжает на станцию. Подробности в <a class=\"level-link\" level-number=\"6\" level-key=\"kama_euro7\">&nbsp;</a>.</p>','<h3>Ж/Д станция, Брест</h3><p>Красное знамя гордо развевается над зданием вокзала, красноармейцы теперь чувствуют себя здесь как дома.</p>','<h3>Ж/Д станция, Брест</h3><p>Напрасно вы разрушили вокзал, хотя похоже, что иного выхода сбежать с поля боя у вас не было. Ну, видно судьба такая.</p>','mono-cell railway brest','mono-cell railway brest flame','mono-cell railway brest soviet','mono-cell railway brest ruined','',1,1,1,3000,150,0,0,0,'c60242c78f201d2f14fc18405ed36846'),(16,NULL,NULL,NULL,'<h3>Удача!</h3><p>Три группы гимназистов присоединились к вашей армии. Всего 165 человек, весьма недурно.</p>','mono-cell bonus',NULL,NULL,'mono-cell bonus ruined','',0,0,1,0,0,165,0,1,NULL),(17,'<h3>Телеграф, Гомель</h3><p>В неспокойные дни революции телеграф не работает для передачи личных сообщений людей, вся его работа сводится к обмену информацией между регулярными частями армии либо между революционными отрядами. Всё зависит от того, кому принадлежит телеграф в этом городе. Неплохо было бы занять его.</p>','<h3>Телеграф, Гомель</h3><p>Отчаянно сражаясь за каждый сантиметр, охрана телеграфа всё же понемногу отходит. Кто знает, чем закончится этот бой. Подробности в <a class=\"level-link\" level-number=\"11\" level-key=\"bone2\">&nbsp;</a>.</p>','<h3>Телеграф, Гомель</h3><p>В тяжелом бою вы всё таки сумели взять телеграф. Ну что ж, подсчитываем потери, реорганизовываемся и снова в бой!</p>','<h3>Телеграф, Гомель</h3><p>Оказалось, охрана телеграфа неспроста отступала — заманивала в ловушку. Благодаря вашей наблюдательности и смекалке, отряд удалось сберечь, но телеграф пришлось уничтожить.</p>','mono-cell telegraph gomel','mono-cell telegraph gomel flame','mono-cell telegraph gomel soviet','mono-cell telegraph gomel ruined','',3,1,1,2000,100,0,0,0,'b764f76b141e817f6b67e830f4498bd8'),(18,'',NULL,NULL,'<h3>Удача!</h3><p>110 бойцов регулярной армии дезертировали, чтобы перейти на вашу сторону.</p>','mono-cell bonus',NULL,NULL,'mono-cell bonus ruined','',0,0,1,0,0,110,0,1,NULL),(19,'<h3>Ж/Д станция, Могилев</h3><p>Снующие туда-сюда маневровые поезда. Грузчики, разгружающие мешки из вагона. Лениво передвигающиеся по перронам рабочие. Опаздывающие пассажиры с сумасшедшими глазами, бегущие к своим вагонам. Всё происходит в обычном ритме железнодорожной станции и со стороны может показаться, что охраны у нее нет. Но так быть не может, просто так вам не отдадут стратегический объект.</p>','<h3>Ж/Д станция, Могилев</h3><p>При виде вашего отряда всё напускное спокойствие станции исчезло, гражданские люди спрятались в безопасной части, а скрытая до этого момента охрана появилась отовсюду. Бой предстоит тяжелый. Подробнее в <a class=\"level-link\" level-number=\"18\" level-key=\"mose5\">&nbsp;</a>.</p>','<h3>Ж/Д станция, Могилев</h3><p>Не без труда удалось занять станцию, безусловно ваш отряд понес потери, но так или иначе, задача выполнена - железная дорога Могилева под вашим контролем.</p>','<h3>Ж/Д станция, Могилев</h3><p>Не удалось так уж просто занять станцию. Отпор, который вам дали караульные и подоспевшие им на выручку силы регулярной армии оказался довольно серьезным и самым логичным решением было бежать, взорвав станцию.</p>','mono-cell railway mogilev','mono-cell railway mogilev flame','mono-cell railway mogilev soviet','mono-cell railway mogilev ruined','',6,1,1,3000,150,0,0,0,'9e37538db9dcded946912fa7c80511fb'),(20,NULL,NULL,NULL,'<h3>Неудача...</h3><p>Дезертиры бывают везде. Вас тоже не обошла стороной эта участь. 170 человек из вашей армии ушли в неизвестном направлении. Видно им совершенно не дороги идеалы марксизма-ленинизма.</p>','mono-cell penalty',NULL,NULL,'mono-cell penalty ruined','',0,0,1,0,0,0,170,1,NULL),(21,'<h3>Телеграф, Брест</h3><p>Пока не захвачен телеграф, говорить об успешности дела революции невозможно, именно поэтому этот объект представляет такой интерес как для вас, так и для ваших врагов.</p>','<h3>Телеграф, Брест</h3><p>Вы приближаетесь к телеграфу, охраняющие его солдаты и офицеры не открывают огня. Интересно, почему же? Подробности в <a class=\"level-link\" level-number=\"5\" level-key=\"6man9\">&nbsp;</a>.</p>','<h3>Телеграф, Брест</h3><p>Телеграф удалось взять довольно просто, оборона сдалась быстро, но даже несмотря на это, потери оказались существенными.</p>','<h3>Телеграф, Брест</h3><p>Кто же знал, что здание заминировано? Повезло еще, что удалось увести остатки армии. Жаль только, что теперь этого здания больше нет.</p>','mono-cell telegraph brest','mono-cell telegraph brest flame','mono-cell telegraph brest soviet','mono-cell telegraph brest ruined','',1,1,1,2000,100,0,0,0,'ebaae01dcc96e02affb89f21be10635b'),(22,'<h3>Военкомат</h3><p>Проходя мимо военкомата вы решили заглянуть в него и к вам присоединились 50 человек.</p>',NULL,NULL,NULL,'mono-cell rectal','mono-cell rectal flame','mono-cell rectal soviet',NULL,'',0,0,1,0,0,50,0,0,'1cbe83b998e97d9453751d9b9f2efc98'),(23,'<h3>Телефон, Витебск</h3><p>Налаженная телефонная связь соединений врага - то, что мешает вам установить свою, советскую, власть на территории города Витебска. Необходимо захватить телефонную станцию. Во что бы то ни стало.</p>','<h3>Телефон, Витебск</h3><p>С криком “Власть - народу!” ваши бойцы смело идут в наступление. Подробнее в <a class=\"level-link\" level-number=\"7\" level-key=\"0sol2\">&nbsp;</a>.</p>','<h3>Телефон, Витебск</h3><p>Захватив телефон вы стали еще на шаг ближе к власти народа, власти простых пролетариев.</p>','<h3>Телефон, Витебск</h3><p>Не удалось захватить телефонную станцию, какая же может быть власть без телефона?</p>','mono-cell phone vitebsk','mono-cell phone vitebsk flame','mono-cell phone vitebsk soviet','mono-cell phone vitebsk ruined','',2,1,1,1000,50,0,0,0,'d513e31c390cce0f57b34343941b46c7'),(24,NULL,NULL,NULL,'<h3>Удача!</h3><p>Рабочие мануфактуры Иосифа Штейна в полном составе, в количестве 210 человек, прибыли для пополнения вашей армии.</p>','mono-cell bonus',NULL,NULL,'mono-cell bonus ruined','',0,0,1,0,0,210,0,1,NULL),(25,'<h3>Ж/Д станция, Гродно</h3><p>Напряжение на станции видно невооруженным взглядом. Офицер со злым лицом короткими, гневными окриками расставляет бойцов по позициям. Оборона станции организована весьма достойно.</p>','<h3>Ж/Д станция, Гродно</h3><p>Здесь надо придумать что-то интересное. Отвлекающий маневр, фланг принимает огонь на себя, остальные силы идут в атаку. Подробнее в <a class=\"level-link\" level-number=\"15\" level-key=\"sims2\">&nbsp;</a>.</p>','<h3>Ж/Д станция, Гродно</h3><p>Слава Богу, тактическое решение было принято верно и отвлекающий маневр помог переместить внимание обороны станции от основных сил. Станция наша, а значит дело революции движется.</p>','<h3>Ж/Д станция, Гродно</h3><p>Отвлекающий маневр не произвел должного эффекта и основные силы были разбиты. Относительным успехом операции можно считать тот факт, что небольшая группа бойцов пробралась таки на станцию и заложила взрывчатку. Теперь в Гродне нет железнодорожной станции, а значит и захватывать нечего.</p>','mono-cell railway grodno','mono-cell railway grodno flame','mono-cell railway grodno soviet','mono-cell railway grodno ruined','',4,1,1,3000,150,0,0,0,'a1a7b9f4d3d677fdd83165284b1f3299');
