INSERT INTO `combo_levels` VALUES (1,'85f3273e3690fcdb270a9d0629cd3491','<h3>Захват города</h3><p>Вы захватили все необходимые коммуникации города и теперь можете установить в нем образцовую советскую власть. Подробнее в <a class=\"level-link\" level-number=\"19\" level-key=\"mamamia66\">&nbsp;</a>.</p>'),(2,'3e8b9da92810eeb0bcf980bdede843b4','<h3>Захват города</h3><p>Вы захватили все необходимые коммуникации города и теперь можете установить в нем образцовую советскую власть. Подробнее в <a class=\"level-link\" level-number=\"20\" level-key=\"miami000\">&nbsp;</a>.</p>');
